import React from "react";
import {
  View,
  Text,
  Image,
  ScrollView,
  StyleSheet,
  Dimensions,
} from "react-native";
import { Svg, Path } from "react-native-svg";
import {
  fontPercentage,
  heightPercentage,
  widthPercentage,
} from "./ResponsiveSize";

import { getStatusBarHeight } from "react-native-status-bar-height";

export default function App() {
  return (
    <View style={stylesheet.container}>
      <View style={stylesheet.header}>
        <Text style={stylesheet.headertext}>üçÑdeepmush</Text>
      </View>
      <View style={stylesheet.body}>
        <Text>body</Text>
        <Image
          style={stylesheet._image_1}
          source={{ uri: imageUrl_image_1 }}
        ></Image>
      </View>
      <View style={stylesheet.footer}>
        <Text>footer</Text>
        <Text
          style={[
            stylesheet._continue_with_twitter,
            {
              position: "relative",
              left: 0,
              top: 0,
              height: "auto",
              transform: [{ translateX: 0 }, { translateY: 0 }],
            },
          ]}
        >
          continue with twitter
        </Text>
      </View>
    </View>
  );
}

const stylesheet = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "yellow",
  },

  header: {
    flex: 0.6,
    alignItems: "center",

    backgroundColor: "green",

    marginTop: getStatusBarHeight(),
  },

  headertext: {
    paddingTop: "25%",
  },

  body: {
    flex: 2,
    backgroundColor: "blue",
  },

  footer: {
    flex: 1.4,
    backgroundColor: "red",
  },

  _image_1: {
    position: "absolute",
    width: widthPercentage(390),
    height: heightPercentage(303),
    borderRadius: 0,
    opacity: 1,
    right: "auto",
    top: heightPercentage(50),
    bottom: "auto",
    transform: [{ translateX: 0 }, { translateY: 0 }, { rotate: "0deg" }],
    backgroundColor: "rgba(0,0,0,0)",
  },
  _continue_with_twitter: {
    position: "absolute",
    width: widthPercentage(263),
    height: "auto",
    left: "50%",
    top: "50%",
    transform: [
      { translateX: -115.5 },
      { translateY: -7.5 },
      { rotate: "0deg" },
    ],
    textDecorationLine: "none",
    lineHeight: widthPercentage(100),
    fontSize: fontPercentage(15),
    color: "rgba(50, 63, 75, 1)",
    textAlign: "center",
    textAlignVertical: "top",
    letterSpacing: 1.25,
  },
});

const imageUrl_image_1 =
  "https://sizze-figma-plugin-images-upload.s3.us-east-2.amazonaws.com/fe45c1fbd6a959d2d502bf5e016fd5c7";
